function Body() {

    return (
        <Container>
            <Box>
                <Typography align='center' variant='h3' sx={{pt: 5, fontWeight: 'bold'}}>
                    Latest News
                </Typography>
                <Typography align='center' variant='h3' sx={{}}>
                    Updates and Tips
                </Typography>
                <Typography align='center' variant='h6' sx={{pt:3, fontWeight: 'light'}}>
                    Welcome to the blog, writen by professionals; It's connect people.
                </Typography>
            </Box>
        </Container>
    )

}

export default Body;
